import React, { useState } from 'react';

function Poke() {
    const [poke, setPoke] = React.useState([]);

    React.useEffect(()=> {
        const url = 'https://pokeapi.co/api/v2/pokemon?limit=1';        
        fetch(url).then((response)=>{
            if (response.ok){
                return response.json();
            }else {
                throw response;
            }
        })
        .then((data) => setPoke(data.results))
        .catch((error)=> console.log('Se rompio todo'));
    }, [])
    return(
        <div>
            {poke?.map(pokemon => {
                return(
                    <div>
                    <h5>{pokemon.name}</h5>
                    <img src="url({pokemon.sprites.back_default}"></img>
                    </div>
                );
            })}
        </div>
    )
}

export default Poke;
